import { NavLink } from "react-router-dom";
import "./panel.css";

function Panel() {
  return (
    <>
      <div className="App">
        <div className="canvas">main panel</div>
        <div className="panel">
          <NavLink to="/sketch-01">sketch-01</NavLink>
          <NavLink to="/sketch-02">sketch-02</NavLink>
          <NavLink to="/sketch-03">sketch-03</NavLink>
          <NavLink to="/sketch-04">sketch-04</NavLink>
          <NavLink to="/sketch-05">sketch-05</NavLink>
        </div>
      </div>
    </>
  );
}

export default Panel;
